  body: "**Merge with extra**: https://github.com/opencv/opencv_extra/pull/542\r\n\
    \r\nDuring the cluster-based detection of circle grids, the detected circle\r\n\
    pattern has to be mapped to 3D-points. When doing this the width (i.e.\r\nmore\
    \ circles) and height (i.e. less circles) of the pattern need to\r\nbe identified\
    \ in image coordinates.\r\n\r\nUntil now this was done by assuming that the shorter\
    \ side in image\r\ncoordinates (length in pixels) corresponds to the height in\
    \ 3D.\r\nThis assumption does not hold if we look at the pattern from\r\na perspective\
    \ where the projection of the width is shorter\r\nthan the projection of the height.\
    \ This in turn lead to misdetections in\r\nalthough the circle pattern was clearly\
    \ visible.\r\n\r\nInstead count how many circles have been detected along two\
    \ edges of the\r\nprojected quadrangle and use the one with more circles as width\
    \ and the\r\none with less as height.\r\n\r\n```\r\nallow_multiple_commits=1\r\
    \n```"
